<template>
    <img 
        :src="imageSrc"
        @mouseenter="mouseenter"
        @mouseleave="mouseleave"
    />
</template>
<script>
export default {
    name: "TheHero",
    data() {
        return {
            imageSrc: "https://www.onamangepourvous.tn/wp-content/uploads/2019/12/nouacer.jpg"
        }
    },
    methods: {
        mouseenter() {
            this.imageSrc = "https://www.tunisieautrement.com/assets/img/articles/7/les-cinq-plats-preferes-des-tunisiens_2.png";
        },
        mouseleave() {
            this.imageSrc = "data:image/jpeg;base64,";
        }
    }
}
</script>